import React from "react";

const Footer = (props) => {
    return (
        <div>
            <footer class="footer">
                <h6>¿Aún no tienes una cuenta?, Registrate</h6>
                <small id="copy">© 2021 List Factory</small>
            </footer>
        </div>
    )
}

export default Footer;
